        userId,
        total = config.Max,
        current = 0,
        steps = (current / total) * 100;
      if (config.Uid) {
        userId = config.Uid;
      } else {
        userId = `${document.domain}_${this.pid}`;
      }

      uploadBtn.type = "file";
      uploadBtn.accept = `image/${config.Format}`;
      uploadBtn.id = `Pd_imgupload_${this.pid}`;
